Binh.service("ServiceToDos",function(){var{http:o,state:t}=Binh,e=t.as("todos");function n(t){e.set(i(t))}function i(o){var n=[];return Object.keys(o).forEach(function(t){var e=o[t];n.push({id:t,text:e.text})}),n}e.schema(function(e){new o("/todos/get").get(function(t){e(i(t))})}),this.define("add",function(t){new o("/todos/add").body({text:t}).post(n)}),this.define("remove",function(t){new o("/todos/remove").body({id:t}).post(n)})});